import Layout from '../components/Layout';
import Container1 from '../components/Container1';
import styled from 'styled-components'
const Div = styled.div`
            display: flex;
`
const About = ()=> (
    <Layout>
        <Div>
            <h1>Games to download</h1>
            <Container1/>
            <Container1/>
            <Container1/>
        </Div>
    </Layout>
);
export default About;
